import { Box, Button, Stack } from "@mui/material";

const pages = [
  { page: "ЦНАП", tabs: ["Profile", "Account", "Dashboard", "Logout"] },
  { page: "Products", tabs: ["Profile", "Account", "Dashboard", "Logout"] },
  { page: "Products", tabs: ["Profile", "Account", "Dashboard", "Logout"] },
];

export const StructureSelect = () => {
  return (
    <Box>
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          p: 3,
        }}
      >
        <Stack direction="row" spacing={2}>
          {pages.map((item) => (
            <Button key={item.page} variant="outlined">
              {item.page}
            </Button>
          ))}
        </Stack>
      </Box>
    </Box>
  );
};
